function selectedPlayers(n,t){$(n).on("changed.bs.select",function(n,i,r,u){console.log(i);console.log(r);console.log(u);var e=$(this).parent().find("div li a")[i].text,o=e.split(" ")[0],f="div li a:contains('"+o+"')";r?$(t).parent().find(f).hide():$(t).parent().find(f).show()})}function refreshPlayerLists(){var n=$(".selectpicker");n.length>0&&(selectedPlayers("#firstTeamSelect","#secondTeamSelect"),selectedPlayers("#secondTeamSelect","#firstTeamSelect"))}function createGame(n){var t={FirstTeam:$("#firstTeamSelect").val(),SecondTeam:$("#secondTeamSelect").val()};$.post(n,t,function(n){$("#gameDiv").html(n);refreshPlayerLists()})}function runClock(n){var t=$(n).FlipClock($(n).text(),{autoStart:!1,countdown:!0,clockFace:"MinuteCounter"});t.start()}$(window).scroll(function(){$(".navbar").offset().top>50?$(".navbar-fixed-top").addClass("top-nav-collapse"):$(".navbar-fixed-top").removeClass("top-nav-collapse")});$(function(){$("a.page-scroll").bind("click",function(n){var t=$(this);$("html, body").stop().animate({scrollTop:$(t.attr("href")).offset().top},1500,"easeInOutExpo");n.preventDefault()});runClock("#currentGameTimeLeft");runClock("#estimatedGameTimeLeft");refreshPlayerLists()});